import { useState, useEffect } from "react";
import axios from "axios";
import Layout from "../layout";
import Filter from "../components/filter";

function Collection(props) {
  const [products, setProducts] = useState([]);

  useEffect((_) => {
    axios
      .post("/products", { category: props.name })
      .then((res) => setProducts(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <Layout>
      <div className="max-[767px]:w-11/12 min-[768px]:w-4/5 pt-20 m-auto">
        <h2 className="text-xl">
          {props.name} Shoes ({products.length > 0 ? products.length : "0"})
        </h2>
        <div className="mt-4 *:inline-block *:align-top">
          <div className="max-[767px]:w-1/4 min-[768px]:w-2/12">
            <Filter />
          </div>
          <div className="w-4/6 mx-9">
            {products.length > 0
              ? products.map((product) => (
                  <div
                    key={product._id}
                    className="inline-block w-3/12 h-1/4 bg-gray-200"
                  >
                    <div className="m-2 w-full h-full">
                      <div className=" w-full h-9/12">
                        <img
                          className="object-cover"
                          src={product.image}
                          alt={product.slug}
                        />
                      </div>
                      <h3>{product.name}</h3>
                      <h4>{product.price}</h4>
                    </div>
                  </div>
                ))
              : "No products found"}
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default Collection;
